  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:08.515336\",\n\t\"name\": \"1984-walrus-harvest-health-and-welfare-study-at-wales-alaska-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish & Wildlife Service contracted
  a local individual to monitor the walrus harvest at Wales in 1984. The recorded
  harvest between 21 May and 30 June in Wales was 271 walruses. The magnitude of the
  harvest was greater than any of the preceding four years. The harvest was comprised
  of 90 adult males (33.2%), 132 adult females (48.8%) 12 calves (4.4%) and 37 adult
  unknown sex (13.6%). A 40:60 male to female sex ratio was exhibited in the harvest
  of known sex adults. The 1982 harvest was the only other year in the last five years
  when the harvest favored females. Approximately 16 man-hours/walrus were expanded
  based upon a sample of 35 hunting trips, 2146.5 man hours effort and retrieval of
  134 walruses. Since some hunting effort was directed toward seals and waterfowl
  during the course of walrus hunting the catch per unit figures should be considered
  as inflated. A total of 15 hunting days occurred during the study period.\",\n\t\"license_title\":
